import Modal from './../../components/Ul/Modal/Modal';
import Auxiliary from './../Auxiliary';

const withErrorHandler = (WrappedComponent) =>{
    return(props) =>{
        return(
            <Auxiliary>
                <Modal>
                    Something didn't work
                </Modal>
               <WrappedComponent {...props}/> 
            </Auxiliary>
 
        );
    }
}


export default withErrorHandler;
